import React from 'react';

export const About = () => {
  return (
    <>
      <div className='about-container'>
        <h2>This is a web assignment for IT-WEB2Y-S23</h2>
        <div>
          It was made by these students:
          <ul>
            <li>Vladislav Sarafutdinov</li>
          </ul>
        </div>
      </div>
    </>
  )
};
